<script src="https://dfrnc.com/lib/library-g.js"></script>
<script>
let num = 0;
let num2 = 250;
TweenMax.set("#confetti > *", {opacity:0, y:-700});
window.onload = () => {
const brainAnim = new TimelineMax({delay:0.3, repeat:-1})
.set("#svgSelebBrain", {opacity:1})
//moveRight
.from("#brainMan", 0.8, {opacity:0, x:100},"firstMove")
//eyes
.to("#headBrain >*:nth-child(5)", 0.2, {scale:0.2, repeat:1, yoyo:true, ease: Power0.easeNone, transformOrigin: "50% 0%"}, "firstMove+=0.6")
.to("#headBrain >*:nth-child(4)", 0.2, {scale:0.2, repeat:1, yoyo:true, ease: Power0.easeNone, transformOrigin: "50% 0%"}, "firstMove+=0.6")
//meanders
for (let i = 0; i < 25; i++) {
   if(i%2 == 0){
      brainAnim .to(`#meanders > *:nth-child(${i})`, 0.5, {x:-3.5, y:3.5, ease: Power0.easeNone, repeat:-1, yoyo:true}, "meanders")
   }else if(i%3 == 0){
      brainAnim .to(`#meanders > *:nth-child(${i})`, 0.5, {x:-4, y:4, ease: Power0.easeNone, repeat:-1, yoyo:true}, "meanders")
   }else{
      brainAnim .to(`#meanders > *:nth-child(${i})`, 0.5, {x:2.5, y:-2.5, ease: Power0.easeNone, repeat:-1, yoyo:true}, "meanders")
   }
}
brainAnim
// //moving right/left
.to("#brainMan>*:nth-child(2)", 0.55, {transformOrigin:"30% 75%", rotation:-5, repeat:3, yoyo:true, ease: Power0.easeNone}, "firstMove+=0.75")
.to("#handUp", 0.55, {transformOrigin:"100% 100%", rotation:-8, repeat:3, yoyo:true, ease: Power0.easeNone}, "firstMove+=0.75")
.to("#handUp >*:nth-child(2)", 0.55, {transformOrigin:"80% 100%", rotation:70, repeat:3, y:-5,yoyo:true, ease: Power0.easeNone}, "firstMove+=0.75")
.to("#handUp >*:nth-child(1)", 0.55, {transformOrigin:"90% 100%", rotation:1, repeat:3, yoyo:true, ease: Power0.easeNone}, "firstMove+=0.75")
.to("#belt", 0.55, {x:4, repeat:3, yoyo:true, ease: Power0.easeNone}, "firstMove+=0.75")
.to("#legs >*:nth-child(2)", 0.55, {transformOrigin:"60% 0%", rotation:8, repeat:1, yoyo:true, ease: Power0.easeNone}, "firstMove+=0.75")
.to("#legs >*:nth-child(1)", 0.55, {transformOrigin:"60% 0%", rotation:-8, repeat:1, yoyo:true, ease: Power0.easeNone}, "firstMove+=1.85")
//jump
.to("#legs>*:nth-child(1)>*:nth-child(2)", 0.4, {transformOrigin: "90% 90%", rotation:6, y:2, ease: Power0.easeNone}, "firstMove+=2.75")
.to("#legs>*:nth-child(1)>*:nth-child(1)", 0.4, {transformOrigin: "5% 10%", rotation:-5, ease: Power0.easeNone}, "firstMove+=2.75")
.to("#legs>*:nth-child(2)>*:nth-child(2)", 0.4, {transformOrigin: "10% 95%", rotation:-6, ease: Power0.easeNone}, "firstMove+=2.75")
.to("#legs>*:nth-child(2)>*:nth-child(1)", 0.4, {transformOrigin: "7% 0%", rotation:4.7, y:-3, ease: Power0.easeNone}, "firstMove+=2.75")

.to("#legs>*:nth-child(1)>*:nth-child(2)", 0.35, {transformOrigin: "90% 90%", rotation:0, y:0, ease: Power0.easeNone}, "firstMove+=3.1")
.to("#legs>*:nth-child(1)>*:nth-child(1)", 0.35, {transformOrigin: "5% 10%", rotation:0, ease: Power0.easeNone}, "firstMove+=3.1")
.to("#legs>*:nth-child(2)>*:nth-child(2)", 0.35, {transformOrigin: "10% 95%", rotation:0, ease: Power0.easeNone}, "firstMove+=3.1")
.to("#legs>*:nth-child(2)>*:nth-child(1)", 0.35, {transformOrigin: "7% 0%", rotation:0, y:0, ease: Power0.easeNone}, "firstMove+=3.1")

.to("#brainMan", 0.4, {y:-180, repeat:1, yoyo:true,ease: Power2.easeOut}, "firstMove+=3.1")
.to("#meanders > *", 0.4, {y: -35, ease: Power2.easeOut, repeat:1, yoyo:true}, "firstMove+=3.1")
.to("#glasses", 0.4, {y:-13, repeat: 1, yoyo:true, ease: Power2.easeOut}, "firstMove+=3.1")
.to("#legs>*:nth-child(2)", 0.4, {transformOrigin: "50% 0%", rotation:8, repeat:1, yoyo:true}, "firstMove+=3.1")
.to("#legs>*:nth-child(1)", 0.4, {transformOrigin: "50% 0%", rotation:-8, repeat:1, yoyo:true}, "firstMove+=3.1")

.to("#legs>*:nth-child(1)>*:nth-child(2)", 0.4, {transformOrigin: "90% 90%", rotation:6, y:2, ease: Power0.easeNone, repeat:1, yoyo:true}, "firstMove+=3.6")
.to("#legs>*:nth-child(1)>*:nth-child(1)", 0.4, {transformOrigin: "5% 10%", rotation:-5, ease: Power0.easeNone, repeat:1, yoyo:true}, "firstMove+=3.6")
.to("#legs>*:nth-child(2)>*:nth-child(2)", 0.4, {transformOrigin: "10% 95%", rotation:-6, ease: Power0.easeNone, repeat:1, yoyo:true}, "firstMove+=3.6")
.to("#legs>*:nth-child(2)>*:nth-child(1)", 0.4, {transformOrigin: "7% 0%", rotation:4.7, y:-3, ease: Power0.easeNone, repeat:1, yoyo:true}, "firstMove+=3.6")
//eyes
.to("#headBrain >*:nth-child(5)", 0.2, {scale:0.2, repeat:1, yoyo:true, ease: Power0.easeNone, transformOrigin: "50% 0%"}, "firstMove+=3.8")
.to("#headBrain >*:nth-child(4)", 0.2, {scale:0.2, repeat:1, yoyo:true, ease: Power0.easeNone, transformOrigin: "50% 0%"}, "firstMove+=3.8")
//lamp
.from("#brainMan>*:nth-child(2)>*:nth-child(5)", 0.5, {transformOrigin:"0% 100%", scale:0, delay:0.1}, "lampTog")
.from("#lamp >*:nth-child(1)", 0.3, {opacity:0, y:40}, "lampTog")
.fromTo("#lamp >*:nth-child(1)", 0.7, {rotation:-2}, {transformOrigin: "50% 100%", rotation:2, repeat:-1, yoyo:true, ease: Power0.easeNone}, "lampMove")
//circles on lamp
.from("#lamp>*:nth-child(2)>*:nth-child(1)", 0.1, {scale:0, transformOrigin: "50% 50%", repeat: -1, repeatDelay:1.5, yoyo:true}, "lampMove")
.from("#lamp>*:nth-child(2)>*:nth-child(3)", 0.1, {scale:0, transformOrigin: "50% 50%", repeat: -1, repeatDelay:1.5, yoyo:true}, "lampMove+=0.1")
.from("#lamp>*:nth-child(2)>*:nth-child(5)", 0.1, {scale:0, transformOrigin: "50% 50%", repeat: -1, repeatDelay:1.5, yoyo:true}, "lampMove+=0.2")
.from("#lamp>*:nth-child(2)>*:nth-child(2)", 0.1, {scale:0, transformOrigin: "50% 50%", repeat: -1, repeatDelay:1.5, yoyo:true}, "lampMove+=0.3")
.from("#lamp>*:nth-child(2)>*:nth-child(4)", 0.1, {scale:0, transformOrigin: "50% 50%", repeat: -1, repeatDelay:1.5, yoyo:true}, "lampMove+=0.4")
.from("#lamp>*:nth-child(2)>*:nth-child(6)", 0.1, {scale:0, transformOrigin: "50% 50%", repeat: -1, repeatDelay:1.5, yoyo:true}, "lampMove+=0.5")
.from("#lamp>*:nth-child(2)>*:nth-child(7)", 0.1, {scale:0, transformOrigin: "50% 50%", repeat: -1, repeatDelay:1.5, yoyo:true}, "lampMove+=0.6")
//eyes

//confetti
.set("#confetti > *", {opacity:1}, "lampMove+=0.6")
for (let i = 1; i < 6; i++){
   brainAnim
   if(i%2 != 0){
   brainAnim
   .to(`#confetti >*:nth-child(${i})`, 3, {y:num2, ease:Power0.easeNone}, `lampMove+=${0.6 + num}`)
   .to(`#confetti >*:nth-child(${i})`, 0.8, {x:10, ease:Power0.easeNone, repeat:3, yoyo:true}, `lampMove+=${0.6 + num}`)
   .to(`#confetti >*:nth-child(${i})`, 0.4, {opacity:0, ease:Power0.easeNone}, `lampMove+=${0.6 + num + 1.7}`)
   }else{
   brainAnim
   .to(`#confetti >*:nth-child(${i})`, 3, {y:num2, ease:Power0.easeNone}, `lampMove+=${0.6 + num}`)
   .to(`#confetti >*:nth-child(${i})`, 0.5, {x:-10, ease:Power0.easeNone, repeat:3, yoyo:true}, `lampMove+=${0.6 + num}`)
   .to(`#confetti >*:nth-child(${i})`, 0.4, {opacity:0, ease:Power0.easeNone}, `lampMove+=${0.6 + num + 1.7}`)
   }
   num+=0.03
   num2+=150
}
brainAnim
.to("#cloak", 0.6, {y:-6, repeat:-1, yoyo:true, ease: Power0.easeNone}, "0")
;
brainAnim.timeScale(1.25);
}
</script>
